import React from 'react';
import { Link } from 'react-router-dom';

const NavigationBar = () => {
  return (
    <AppBar>
            <Toolbar>
                <IconButton
                    size="large"
                    edge="start"
                    color="inherit"
                    aria-label="menu"
                    sx={{ mr: 2 }}
                >
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6"
                    component="div" sx={{ flexGrow: 1 }}>
                    Geeksforgeeks
                </Typography>
                <Button color="inherit">Logout</Button>
            </Toolbar>
        </AppBar>
  );
};

export default NavigationBar;
